INSERT INTO `article` VALUES ('1', '10', '关于我们', '<p><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>利安众筹是中国最具影响力的众筹平台，是网信金融集团旗下的众筹模式网站，为项目发起者提供募资、投资、孵化、运营一站式综合众筹服务。</p><p><br/></p><p><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>自2013年2月成立以来，已上线利安众筹、众筹制造、开放平台、众筹国际、金融众筹、股权众筹六大板块。其中，利安众筹联合长安保险推出的“爱情保险”项目创出了国内融资额最高众筹记录，筹资额超过600万元！“快男电影”项目近4万人次参与，创出投资人最多的记录。</p><p><br/></p>', '关于我们', '关于我们', '关于我们', null, '-1', '1', '1456706990', '1456708002');
INSERT INTO `article` VALUES ('2', '11', '常见问题', '<p><strong><span style=\"color: rgb(255, 0, 0);\">1、众筹是什么？</span></strong><br/><br/>众筹译自crowdfunding，即大众筹资。当代众筹指通过互联网发布筹款项目并筹集资金。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">2、仌仌众筹分为几大模块？</span></strong><br/><br/>仌仌众筹分为两大模块：仌仌众梦、一元夺宝。</p><p>仌仌众梦：</p><p>仌仌众梦—为实现梦想而生，一站式综合众筹服务平台，是具有较大影响力的专业众筹平台。其LOGO代表的是集众人之力互助圆梦的理念，让你的梦想不再是白日做梦。</p><p><br/></p><p>一元夺宝：<br/><br/>◆每件物品参考市场价平分成相应“等份”，每份1元，1份对应1个幸运码。<br/><br/>◆同一件物品可以多次购买，同时可获得相等数量的幸运码。<br/><br/>◆当一件商品所有等份全部售出后，计算出一个“幸运码”，拥有“幸运码”者即可获得此物品。<br/><br/>幸运码计算方式：<br/><br/>◆活动开始后，当物品的最后一元被购买，此时计算出幸运码。中奖号码的计算是取最后一元的购买者前100条全站的时间记录。（全站记录是指所有参与夺宝人员的记录，并不是单独一个活动记录）。<br/><br/>◆时间记录是按时、分、秒、毫秒一次排列组成一组数值。例如11:22:33:123转换后就是11223312.<br/><br/>◆将这100组时间数值合计，再与设置的价钱取余数，此余数加上10000000组成最终的“幸运码”。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">3、什么人可以发起项目？</span></strong><span style=\"color: rgb(255, 0, 0);\"><br/></span><br/>在仌仌的平台里，只要是有梦想想圆梦的每个人都可以发起自己的项目。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">4、发起项目的要求是什么？</span></strong><br/><br/>您需要支持至少一个项目，才有资格发起自己的项目。</p><p><br/><strong><span style=\"color: rgb(255, 0, 0);\">5、怎样获得项目的发起资格？</span></strong><br/><br/>首先应满足发起项目的要求，用户至少支持一个项目，才有资格发起自己的项目。<br/><br/>在仌仌的白日梦、屌丝梦、土豪梦、入道梦、超神梦五大圆梦模块中，选择出你想要支持帮助的项目，支持某个项目10元，可获得10元*10倍的项目资格，意思是说你投资100元可获得1000以内的物品，以此类推。<br/><br/>每天支持项目的最大金额为100元，可获得100*10倍的项目资格，1000元定为每天增长的上限。如果支持的项目超过100元，那么获得的项目资格依旧是1000元。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">6、每天获得的最大项目资格是多少？</span></strong><br/><br/>每天支持项目的最大金额为100元，可获得100*10倍的项目资格，1000元定为每天增长的上限。如果支持的项目超过100元，那么获得的项目资格依旧是1000元。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">7、发起项目需要填写哪些内容，需要注意哪些？</span></strong><br/>首先需注意的是发起的项目品类，比如：涉及到食品、药品、服装、鞋类、宠物等不能发起，如果项目发起成功，审核也不能通过。<br/>◆选择正确的收货地址（众筹成功后，仌仌会根据填写的收货地址发送物品，确保正确无误的收货地址以及联系方式等）<br/><br/>◆项目标题（物品名称）<br/><br/>◆参考价格（根据项目发起最大金额和网上的报价填写）<br/><br/>◆参考链接（复制网上的商品网址粘贴到这里）<br/><br/>◆筹款目的（想要获得物品的心情）<br/><br/>◆重要通知（认真阅读后提交）<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">8、仌仌众梦如何收费？</span></strong><br/><br/>&nbsp;用户发起的项目众筹成功后，公司将会收取项目总金额的10%，作为项目支付渠道费用，由用户自行支付。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">9、仌仌众梦如何审核项目？</span></strong><br/><br/>项目发起并提交审核后，仌仌工作人员会第一时间对项目进行审核，主要审核项目的填写内容是否完整，发起的项目是否符合。<br/><br/>用户成功发起众筹项目，审核通过后最终的众筹金额包含商品邮费等费用(汽车、房产等项目包含购置税)，由公司进行核算。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">10、项目提交后审核未通过是怎么回事</span></strong><br/><br/>项目提交审核拒绝后，右上角提示未通过，需要根据下边的审核失败原因重新修改进行提交或者拨打客服电话进行咨询。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">11、如何尽快的完成发起的项目？</span></strong><br/><br/>项目上线后，建议您自己积极自主的推广，带动项目筹资金额，根据自己的朋友圈、身边的朋友进行宣传尽快完成项目。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">12、为什么我不能发起第二个众筹？</span></strong><br/><br/>一个用户不能同时拥有两个正在进行的项目，一个项目完成之后才能正常发起第二个项目。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">13、项目是如何排序的？</span></strong><br/><br/>项目的先后排序是根据声望值等级的高低进行排序的，声望值等级越高，项目的排列顺序越靠前。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">14、怎样获取声望值？</span></strong><br/><br/>◆每日签到可以获取声望值<br/><br/>◆在声望专区购买声望值，1元钱等于10个声望值。<br/><br/><strong><span style=\"color: rgb(255, 0, 0);\">15、项目成功后怎样获得物品？</span></strong><br/><br/>项目众筹成功后，仌仌会根据您提交物品的网址并有商品保障的商家去购买，购买成功后会在3-10个工作日快递到您手里的。<br/></p><p><br/></p><p><strong><span style=\"color: rgb(255, 0, 0);\">16、各个模块的项目完成周期是多长时间？</span></strong></p><p>一元夺宝：没有周期天数的限定，只要商品众筹完成后立即开奖。</p><p>白日梦：众筹项目周期天数为一天，如果当天项目未完成将自动排序到第二天的众筹项目中。</p><p>屌丝梦：众筹项目周期天数为三天，如果三天之内项目未完成将自动排序到下一个周期中进行排序。</p><p>土豪梦：众筹项目周期天数为五天，如果五天之内项目未完成将自动排序到下一个周期中进行排序。</p><p>入道梦：众筹项目周期天数为七天，如果七天之内项目未完成将自动排序到下一个周期中进行排序。</p><p>超神梦：众筹项目周期天数为九天，如果七天之内项目未完成将自动排序到下一个周期中进行排序。</p><p><br/></p><p><strong><span style=\"color: rgb(255, 0, 0);\">17、仌仌众梦的商品是正品吗？怎么保证？会提供发票吗？</span></strong></p><p>仌仌众梦承诺，所有商品100%正品，可享受厂家所提供的全国联保服务，享受商品的保修、换货和退货的义务（国家三包政策），支持专柜验货。</p><p><br/></p><p><strong><span style=\"color: rgb(255, 0, 0);\">18、获得的商品在使用过程中出现问题怎么办？</span></strong></p><p>若您获得的商品在保修期使用异常，可直接拨打商品的售后服务热线，了解离您距离最近的售后服务店，携商品以及附件（充电器、数据线、保修卡）享受免费保修服务。</p>', '常见问题', '常见问题', '常见问题', null, '-1', '1', '1456707030', '1460165716');
INSERT INTO `article` VALUES ('3', '15', '协议服务条款', '<p style=\"text-align:center\"><strong><span style=\"font-size:21px;font-family:宋体\">用户注册服务协议</span></strong></p><p><strong><span style=\"font-size:21px;font-family:宋体\"><br/></span></strong></p><p style=\"text-indent:32px\">仌仌众梦（<a href=\"http://www.bingbingzm.com\">www.bingbingzm.com</a>）是河北保定利安众筹电子商务有限公司运营的网络平台，本协议的双方是仌仌众梦的注册用户（简称“您”）与仌仌众梦。在您注册并使用“仌仌众梦”提供的各项服务之前，请您务必仔细阅读并透彻理解本协议条款。如果您同意注册并使用“仌仌众梦”提供的服务，视为您已经认真阅读、理解并完全接受了本协议全部内容，本协议即时在您与仌仌众梦之间发生法律效力。</p><p>1<span style=\"font-family:宋体\">、您应是具有完全民事权利能力和民事行为能力的自然人，或依法设立并有效存续的单位（包括企业法人及其他组织）。</span>&nbsp;</p><p>2<span style=\"font-family:宋体\">、您应妥善保管您的登录用户名和密码，使用您的用户名和密码登陆仌仌众梦进行的任何操作，将视为您本人的操作，一切后果由您本人承担。如果您的用户名或密码泄露，您应立即通知我们，以避免可能的损失。</span>&nbsp;</p><p>3<span style=\"font-family:宋体\">、您在注册时及在使用仌仌众梦提供的服务时提供的相关资料及信息应真实、准确、有效、完整，且不存在误导陈述，不侵害其他人的知识产权及合法权益。前述资料及信息包括：您在注册或登录过程中、在任何公共信息区域（包括留言栏或反馈区）或通过任何电邮形式或手机短信向仌仌众梦或其他用户提供的所有内容。</span></p><p style=\"text-indent:7px\">4<span style=\"font-family:宋体\">、为更好地保护您的合法权益并向您提供优质、高效的服务，仌仌众梦可能将您的信息应用在以下方面：</span></p><p style=\"text-indent:7px\">（1）在您登录仌仌众梦时进行必要的身份验证；<br/>（2）根据您的浏览记录及相关信息，向您推荐您可能感兴趣的项目资料；<br/>（3）针对您通过仌仌众梦提出的任何相关问题及时予以回复，并提供必要的协助；<br/>（4）分析仌仌众梦的用户需求及使用情况，以便为您提供更优质的服务；<br/>（5）用于向您提供的其他相关服务，比如向您发送仌仌众梦的有关通知、服务公告等。</p><p>5<span style=\"font-family:宋体\">、您对仌仌众梦发布的项目提供众筹支持时，应认真阅读众筹网发布的有关该项目的一切信息。如果您确定为某项目提供众筹支持，视为您已经完全理解并接受该项目的相关内容及风险，一切后果由您本人承担，仌仌众梦不承担任何责任。</span></p><p>6<span style=\"font-family:宋体\">、仌仌众梦不保证发布的所有项目均能够众筹成功，如项目众筹失败，项目发起人或项目支持人不得要求仌仌众梦承担任何责任。</span></p><p>7<span style=\"font-family:宋体\">、仌仌众梦应对您提供的信息履行保密义务，非为本协议约定之目的或按照法律、法规、有权机关的要求进行信息披露外，未经您事先书面同意，仌仌众梦不应向任何第三方披露哦您的信息。</span></p><p>8<span style=\"font-family:宋体\">、您在使用仌仌众梦提供的服务时应遵守中华人民共和国相关法律法规、不得将本服务用于任何非法目的，也不得以任何非法方式使用本服务。</span></p><p>9<span style=\"font-family:宋体\">、当您存在包括但不限于下列情形之一时，仌仌众梦有权立即终止向您提供服务而无需承担任何责任，并有权要求您赔偿仌仌众梦因此遭受的一切损失：</span></p><p><span style=\"font-family:宋体\">（</span>1<span style=\"font-family:宋体\">）违反本协议的约定；</span></p><p><span style=\"font-family:宋体\">（</span>2<span style=\"font-family:宋体\">）冒用他人名义使用本服务；</span></p><p><span style=\"font-family:宋体\">（</span>3<span style=\"font-family:宋体\">）利用本服务侵害他人的合法权益；</span></p><p><span style=\"font-family:宋体\">（</span>4<span style=\"font-family:宋体\">）从事非法交易，如洗钱、贩卖枪支、毒品、禁药、盗版软件、淫秽物品等；</span></p><p><span style=\"font-family:宋体\">（</span>5<span style=\"font-family:宋体\">）从事任何可能含有电脑病毒或可能侵害本服务系统之行为；</span></p><p><span style=\"font-family:宋体\">（</span>6<span style=\"font-family:宋体\">）仌仌众梦认为向您提供本服务存在风险的；</span></p><p><span style=\"font-family:宋体\">（</span>7<span style=\"font-family:宋体\">）其他导致仌仌众梦终止向您提供服务的行为。</span><br/></p><p>10<span style=\"font-family:宋体\">、您理解并同意，仌仌众梦不对因下述任一情况导致的您的任何损害承担赔偿责任，包括但不限于利润、商誉、使用、数据等方面的损失或其他无形损失的损害赔偿（无论仌仌众梦是否已被告知该等损害赔偿发生的可能性）：</span></p><p><span style=\"font-family:宋体\">（</span>1<span style=\"font-family:宋体\">）仌仌众梦基于单方判断（包括但不限于仌仌众梦认为您已经违反相关法律法规或本协议的约定），暂停、中止或终止向您提供全部或部分服务，并移除您的资料。</span></p><p><span style=\"font-family:宋体\">（</span>2<span style=\"font-family:宋体\">）如果仌仌众梦发现您违反法律法规或本协议约定使用仌仌众梦提供的服务，或认为您存在违反法律规定或本协议约定的可能时，有权不经通知先行暂停或终止向您提供全部或部分服务，且无需向您承担任何责任。</span></p><p>11<span style=\"font-family:宋体\">、因以下任一情形导致您无法使用全部或部分服务时，仌仌众梦不承担任何责任，该情形包括但不限于：</span></p><p><span style=\"font-family:宋体\">（</span>1<span style=\"font-family:宋体\">）仌仌众梦在网站公告之系统停机维护期间；</span></p><p><span style=\"font-family:宋体\">（</span>2<span style=\"font-family:宋体\">）电信设备出现故障不能进行数据传输的；</span></p><p><span style=\"font-family:宋体\">（</span>3<span style=\"font-family:宋体\">）您的银行卡发卡银行的原因导致的服务中断或延迟；</span></p><p><span style=\"font-family:宋体\">（</span>4<span style=\"font-family:宋体\">）因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力之因素，造成仌仌众梦系统障碍不能执行业务的；</span></p><p><span style=\"font-family:宋体\">（</span>5<span style=\"font-family:宋体\">）由于黑客攻击、电信部门技术调整或故障、网站升级等原因而造成的服务中断或延迟。</span></p><p>12<span style=\"font-family:宋体\">、仌仌众梦依据本协议约定中止或终止向您提供服务后，并不能免除您在中止或终止前实施的行为应承担的任何法律后果。</span></p><p>13<span style=\"font-family:宋体\">、本协议的成立、生效、履行，均适用中华人民共和国法律解释。</span></p><p>14<span style=\"font-family:宋体\">、仌仌众梦发布的各类规则、协议、条款等，构成本协议不可分割的组成部分，仌仌众梦有权适时调整本协议的内容，并在仌仌众梦公布，如您不能接受变更后的协议内容，请立即停止使用仌仌众梦为您提供的服务，如您继续适用，视为您理解并接受调整后的本协议。</span></p><p>15<span style=\"font-family:宋体\">、双方在履行本协议的过程中，如发生争议，应协商解决。协商不成的，应提交河北省保定市人民法院诉讼解决。</span></p><p><br/></p>', '协议服务条款', '协议服务条款', '协议服务条款', null, '-1', '1', '1457405222', '1459395539');
