INSERT INTO `article` VALUES ('5', '11', '操作指南', '<p style=\"text-align:center\"><br/></p><p><strong><span style=\"font-size:19px;font-family:宋体\">白日梦操作指南：</span></strong></p><p><strong><span style=\"font-size:19px;font-family:宋体\"></span></strong><span style=\"font-family:宋体\">◆</span><span style=\"font-family:宋体\">白日梦发起项目的资格是</span>1-999<span style=\"font-family:宋体\">元，众筹周期天数为一天，如果一天之内项目没有众筹成功自动下线，排序到第二天的众筹项目中；</span></p><p><span style=\"font-family:宋体\">◆首先获得发起项目资格，从白日梦、屌丝梦、土豪梦、超神梦、入道梦五个模块中选择好你想要帮助支持的项目，进入项目详情页，点击帮他圆梦，选择金额（可以选项可以输入）进行支付，帮助项目10元则可获得100元的发起项目资格，以此类推；</span></p><p><span style=\"font-family:宋体\">◆进入“我要发起”模块，根据提示最大项目发起资格金额，选择收货地址，填写项目名称，参考价格，参考链接，筹款目的，填写完整后进行提交；</span></p><p><span style=\"font-family:宋体\">◆提交项目后，仌仌会在第一时间进行审核；</span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">审核通过或拒绝后，仌仌会给您发个提示信息，提示您的项目已审核成功或失败；</span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">审核成功后，左下角会显示您的项目预计上线时间、排列顺序等；</span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">审核失败后，右上角会显示未通过，这是应点击进去查看项目失败的原因，修改后重新提&nbsp;&nbsp;&nbsp;&nbsp; </span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">交，等待审核；</span></p><p><span style=\"font-family:宋体\">◆排列顺序是根据您的声望值等级进行排序的，怎样获得更高的等级呢？</span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">每日签到：每天签到一次获得1个声望值；</span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">声望专区：在声望专区可以购买声望值，1元钱等于10个声望值，等级越高，发起项目 </span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">的排列顺序越靠前；</span></p><p><span style=\"font-family:宋体\">◆项目上线后，建议您自己积极自主的推广，带动项目筹资金额，根据自己的朋友圈，身边&nbsp; </span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">的亲朋好友进行宣传尽快完成项目；</span></p><p><span style=\"font-family:宋体\">◆项目众筹成功后，仌仌会根据您提交的物品参考链接去有商品保障的商家购买，购买成功&nbsp; </span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">后会在3-10个工作日快递到您的手里，您可以在个人中心的我的订单，待发货，待收货&nbsp; </span></p><p><span style=\"font-family:宋体\">&nbsp; </span><span style=\"font-family:宋体\">查询物品的物流信息；</span></p><p><span style=\"font-family:宋体\">◆收到物品后，请您确认收货。如非质量问题，不在三包范围内，不能给予退换货。</span></p><p><strong><span style=\"font-family:宋体\">其它模块操作等同以上内容。</span></strong></p><p><br/><span style=\"font-family:宋体\"></span></p><p><span style=\"font-size: 20px;\"><strong><span style=\"font-family: 宋体;\">一元夺宝操作指南：</span></strong></span><span style=\"font-family:宋体\"></span></p><p><span style=\"font-family:宋体\"><img style=\"width: 344px; height: 334px;\" alt=\"4.jpg\" src=\"http://0412.jiaoyinet.com/upload/b6/f5/b6f55c6016e92e37347c3b054ed80dbf3d2ab687..jpg\" title=\"b6f55c6016e92e37347c3b054ed80dbf3d2ab687..jpg\" height=\"334\" width=\"344\"/></span></p><p><span style=\"font-family:宋体\"><img style=\"width: 343px; height: 388px;\" alt=\"5.jpg\" src=\"http://0412.jiaoyinet.com/upload/a3/a3/a3a3fb84bfbbf87ab58ad8ed3c1b41a7537ac754..jpg\" title=\"a3a3fb84bfbbf87ab58ad8ed3c1b41a7537ac754..jpg\" height=\"388\" width=\"343\"/></span></p><p><strong>一元夺宝规则：</strong><br/><br/>◆每件物品参考市场价平分成相应“等份”，每份1元，1份对应1个幸运码。<br/><br/>◆同一件物品可以多次购买，同时可获得相等数量的幸运码。<br/><br/>◆当一件商品所有等份全部售出后，计算出一个“幸运码”，拥有“幸运码”者即可获得此物品。<br/><br/><strong>幸运码计算方式：</strong><br/><br/>◆活动开始后，当物品的最后一元被购买，此时计算出幸运码。中奖号码的计算是取最后一元的购买者前100条全站的时间记录。（全站记录是指所有参与夺宝人员的记录，并不是单独一个活动记录）。<br/><br/>◆时间记录是按时、分、秒、毫秒一次排列组成一组数值。例如11:22:33:123转换后就是11223312.<br/><br/>◆将这100组时间数值合计，再与设置的价钱取余数，此余数加上10000000组成最终的“幸运码”。<span style=\"font-family:宋体\"></span></p><p><span style=\"font-family:宋体\"><br/></span></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>', '操作指南', '操作指南', '仌仌众梦操作指南', null, '-1', '1', '1458699279', '1459932600');
INSERT INTO `article` VALUES ('6', '11', '发起项目的提示 勿删', '<p><img alt=\"操作指南1.png\" src=\"http://0412.jiaoyinet.com/upload/44/63/446328212a893a24ce284744e51b7f576482955b..png\" title=\"446328212a893a24ce284744e51b7f576482955b..png\"/><span style=\"font-family: 宋体; color: rgb(255, 0, 0);\">重要通知：</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">1、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp; </span><span style=\"font-family:宋体\">用户成功发起众筹项目，审核通过后最终的众筹金额包含商品邮费等费用</span>(<span style=\"font-family:宋体\">汽车、房产等项目包含购置税</span>)<span style=\"font-family:宋体\">，由公司进行核算。</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">2、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp; </span><span style=\"font-family:宋体\">用户发起的项目众筹成功后，公司将会收取项目总金额的</span>10%<span style=\"font-family:宋体\">，作为项目支付渠道费用，由用户自行支付。</span></p><p class=\"MsoListParagraph\" style=\"margin-left:24px\">3、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp; </span><span style=\"font-family:宋体\">仌仌众梦—为实现梦想而生，一站式综合众筹服务平台，是具有较大影响力的专业众筹平台。其</span>LOGO<span style=\"font-family:宋体\">代表的是集众人之力互助圆梦的理念，一直走到今天，平台将给大家呈现一个</span>0<span style=\"font-family:宋体\">元实现梦想的机会。自</span>2016<span style=\"font-family:宋体\">年</span>4<span style=\"font-family:宋体\">月</span>1<span style=\"font-family:宋体\">日至</span>2016<span style=\"font-family:宋体\">年</span>8<span style=\"font-family:宋体\">月</span>1<span style=\"font-family:宋体\">日，推出“</span>0<span style=\"font-family:宋体\">元圆梦”活动，在此期间公司平台不予收取任何费用，</span>0<span style=\"font-family:宋体\">元实现梦想。如果之前你有做过白日梦，那赶紧来圆梦吧，让你的梦不再是白日做梦。。</span></p><p><br/></p>', '发起项目提示', '发起项目提示', '发起项目提示', null, '-1', '1', '1458704227', '1458984114');
INSERT INTO `article` VALUES ('7', '11', '我的声望·声望值说明', '<p><strong><span style=\"font-size:21px;font-family:宋体\">声望值&amp;等级说明</span></strong></p><p><strong><span style=\"font-size:16px\">1-5</span></strong><strong><span style=\"font-size:16px;font-family:宋体\">级：每级增加</span></strong><strong><span style=\"font-size:16px\">100</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">个声望值方可上升一级别。</span></strong></p><p><span style=\"font-family:宋体\">零级（</span>1<span style=\"font-family:宋体\">个灰色小人</span>LOGO<span style=\"font-family:宋体\">）声望值为</span>0<span style=\"font-family:宋体\">的用户</span></p><p><span style=\"font-family:宋体\">一级（</span>1<span style=\"font-family:宋体\">个小人</span>LOGO<span style=\"font-family:宋体\">）声望值大于</span>0<span style=\"font-family:宋体\">且小于等于</span>1<span style=\"font-family:宋体\">的用户</span></p><p><span style=\"font-family:宋体\">二级（</span>2<span style=\"font-family:宋体\">个小人</span>LOGO<span style=\"font-family:宋体\">）声望值大于</span>1<span style=\"font-family:宋体\">且小于等于</span>100<span style=\"font-family:宋体\">的用户</span></p><p><span style=\"font-family:宋体\">三级（</span>3<span style=\"font-family:宋体\">个小人</span>LOGO<span style=\"font-family:宋体\">）声望值大于</span>100<span style=\"font-family:宋体\">且小于等于</span>200<span style=\"font-family:宋体\">的用户</span></p><p><span style=\"font-family:宋体\">四级（</span>4<span style=\"font-family:宋体\">个小人</span>LOGO<span style=\"font-family:宋体\">）声望值大于</span>200<span style=\"font-family:宋体\">且小于等于</span>300<span style=\"font-family:宋体\">的用户</span></p><p><span style=\"font-family:宋体\">五级（</span>1<span style=\"font-family:宋体\">个全</span>LOGO<span style=\"font-family:宋体\">）声望值大于</span>300<span style=\"font-family:宋体\">且小于等于</span>400<span style=\"font-family:宋体\">的用户</span></p><p>&nbsp;</p><p><strong><span style=\"font-size:16px\">6-10</span></strong><strong><span style=\"font-size:16px;font-family:宋体\">级：每级增加</span></strong><strong><span style=\"font-size:16px\">500</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">个声望值方可上升一级别。</span></strong></p><p><span style=\";font-family:宋体\">六级（全</span>LOGO+1<span style=\";font-family:宋体\">个）声望值大于</span>400<span style=\";font-family:宋体\">且小于等于</span>900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">七级（全</span>LOGO+2<span style=\";font-family:宋体\">个）声望值大于</span>900<span style=\";font-family:宋体\">且小于等于</span>1400<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">八级（全</span>LOGO+3<span style=\";font-family:宋体\">个）声望值大于</span>1400<span style=\";font-family:宋体\">且小于等于</span>1900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">九级（全</span>LOGO+4<span style=\";font-family:宋体\">个）声望值大于</span>1900<span style=\";font-family:宋体\">且小于等于</span>2400<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十级（</span>2<span style=\";font-family:宋体\">个全</span>LOGO<span style=\";font-family:宋体\">）声望值大于</span>2400<span style=\";font-family:宋体\">且小于等于</span>2900<span style=\";font-family:宋体\">的用户</span></p><p>&nbsp;</p><p><strong><span style=\"font-size:16px\">11-15</span></strong><strong><span style=\"font-size:16px;font-family:宋体\">级：每级增加</span></strong><strong><span style=\"font-size:16px\">1000</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">个声望值方可上升一级别。</span></strong></p><p><span style=\";font-family:宋体\">十一级（</span>2<span style=\";font-family:宋体\">个全</span>LOGO+1<span style=\";font-family:宋体\">个）声望值大于</span>2900<span style=\";font-family:宋体\">且小于等于</span>3900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十二级（</span>2<span style=\";font-family:宋体\">个全</span>LOGO+2<span style=\";font-family:宋体\">个）声望值大于</span>3900<span style=\";font-family:宋体\">且小于等于</span>4900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十三级（</span>2<span style=\";font-family:宋体\">个全</span>LOGO+3<span style=\";font-family:宋体\">个）声望值大于</span>4900<span style=\";font-family:宋体\">且小于等于</span>5900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十四级（</span>2<span style=\";font-family:宋体\">个全</span>LOGO+4<span style=\";font-family:宋体\">个）声望值大于</span>5900<span style=\";font-family:宋体\">且小于等于</span>6900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十五级（</span>3<span style=\";font-family:宋体\">个全</span>LOGO<span style=\";font-family:宋体\">）声望值大于</span>6900<span style=\";font-family:宋体\">且小于等于</span>7900<span style=\";font-family:宋体\">的用户</span></p><p>&nbsp;</p><p><strong><span style=\"font-size:16px\">16-19</span></strong><strong><span style=\"font-size:16px;font-family:宋体\">级：每级增加</span></strong><strong><span style=\"font-size:16px\">5000</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">个声望值方可上升一级别。</span></strong></p><p><span style=\";font-family:宋体\">十六级（</span>3<span style=\";font-family:宋体\">个全</span>LOGO+1<span style=\";font-family:宋体\">）声望值大于</span>7900<span style=\";font-family:宋体\">且小于等于</span>12900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十七级（</span>3<span style=\";font-family:宋体\">个全</span>LOGO+2<span style=\";font-family:宋体\">）声望值大于</span> 12900<span style=\";font-family:宋体\">且小于等于</span>17900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十八级（</span>3<span style=\";font-family:宋体\">个全</span>LOGO+3<span style=\";font-family:宋体\">）声望值大于</span>17900<span style=\";font-family:宋体\">且小于等于</span>22900<span style=\";font-family:宋体\">的用户</span></p><p><span style=\";font-family:宋体\">十九级（</span>3<span style=\";font-family:宋体\">个全</span>LOGO+4<span style=\";font-family:宋体\">）声望值大于</span>22900<span style=\";font-family:宋体\">且小于等于</span>27900<span style=\";font-family:宋体\">的用户</span></p><p>&nbsp;</p><p><strong><span style=\"font-size:16px;font-family:宋体\">二十级</span></strong><strong><span style=\"font-size:16px\">{4</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">个全</span></strong><strong><span style=\"font-size:16px\">LOGO</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">）声望值大于</span></strong><strong><span style=\"font-size:16px\">27900</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">的用户</span></strong></p><p><strong><span style=\"font-size:16px\">&nbsp;</span></strong></p><p><strong><span style=\"font-size:16px\">&nbsp;</span></strong></p><p><strong><span style=\"font-size:16px;font-family:宋体\">备注：等级越高，发起者的项目排列顺序越靠前。</span></strong></p><p><strong><span style=\"font-size:16px\">&nbsp;</span></strong></p><p><strong><span style=\"font-size:16px\">&nbsp;</span></strong></p><p><strong><span style=\"font-size:16px;font-family:宋体\">怎样获得声望值：</span></strong></p><p class=\"MsoListParagraph\" style=\"margin-left:25px\"><strong><span style=\"font-size:16px\">1、</span></strong><strong><span style=\"font-size:16px;font-family: 宋体\">每日从签到处签到成功后方可获得一个声望值。</span></strong></p><p class=\"MsoListParagraph\" style=\"margin-left:25px\">2、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp; </span><strong><span style=\"font-size:16px;font-family: 宋体\">在声望专区购买声望值，1元钱等于10个声望值。</span></strong></p><p><br/></p>', '我的声望·声望值说明', '我的声望·声望值说明', '我的声望·声望值说明', null, '-1', '1', '1458868554', '1460164984');
INSERT INTO `article` VALUES ('8', '11', '资格说明', '<p style=\"text-indent: 16px; text-align: center;\"><strong><span style=\"font-size:16px;font-family: 宋体\">怎样获得项目发起的资格？</span></strong></p><p style=\"text-indent:16px\"><strong><span style=\"font-size:16px;font-family: 宋体\"><br/></span></strong></p><p style=\"text-indent:24px\"><span style=\"font-size:16px;font-family:宋体\">首先应满足发起项目的要求，用户至少支持一个项目，才有资格发起自己的项目。</span></p><p style=\"text-indent:24px\"><span style=\"font-size:16px;font-family:宋体\">在仌仌的白日梦、屌丝梦、土豪梦、入道梦、超神梦五大圆梦模块中，选择出你想要支持帮助的项目，支持某个项目</span><span style=\"font-size:16px\">10</span><span style=\"font-size:16px;font-family:宋体\">元，可获得</span><span style=\"font-size:16px\">10</span><span style=\"font-size:16px;font-family: 宋体\">元</span><span style=\"font-size: 16px\">*10</span><span style=\"font-size:16px;font-family:宋体\">倍的项目资格，意思是说你投资</span><span style=\"font-size:16px\">100</span><span style=\"font-size:16px;font-family:宋体\">元可获得</span><span style=\"font-size:16px\">1000</span><span style=\"font-size:16px;font-family: 宋体\">以内的物品，以此类推。</span></p><p style=\"text-indent:24px\"><span style=\"font-size:16px;font-family:宋体\">每天支持项目的最大金额为</span><span style=\"font-size:16px\">100</span><span style=\"font-size:16px;font-family:宋体\">元，可获得</span><span style=\"font-size:16px\">100*10</span><span style=\"font-size:16px;font-family: 宋体\">倍的项目资格，</span><span style=\"font-size:16px\">1000</span><span style=\"font-size:16px;font-family: 宋体\">元定为每天增长的上限。如果支持的项目超过</span><span style=\"font-size:16px\">100</span><span style=\"font-size:16px;font-family: 宋体\">元，那么获得的项目资格依旧是</span><span style=\"font-size:16px\">1000</span><span style=\"font-size:16px;font-family: 宋体\">元。</span></p><p><br/></p>', '资格说明', '资格说明', '资格说明资格说明资格说明资格说明', null, '-1', '1', '1459160312', '1459325504');
INSERT INTO `article` VALUES ('9', '9', '了解仌仌', '<p><strong>仌仌众筹分为两大模块：仌仌众梦、一元夺宝。</strong></p><p><br/></p><p><strong>仌仌众梦：</strong></p><p>仌仌众梦—为实现梦想而生，一站式综合众筹服务平台，是具有较大影响力的专业众筹平台。其LOGO代表的是集众人之力互助圆梦的理念，让你的梦想不再是白日做梦。</p><p><br/></p><p><strong>一元夺宝：</strong><br/><br/>◆每件物品参考市场价平分成相应“等份”，每份1元，1份对应1个幸运码。<br/><br/>◆同一件物品可以多次购买，同时可获得相等数量的幸运码。<br/><br/>◆当一件商品所有等份全部售出后，计算出一个“幸运码”，拥有“幸运码”者即可获得此物品。<br/><br/>幸运码计算方式：<br/><br/>◆活动开始后，当物品的最后一元被购买，此时计算出幸运码。中奖号码的计算是取最后一元的购买者前100条全站的时间记录。（全站记录是指所有参与夺宝人员的记录，并不是单独一个活动记录）。<br/><br/>◆时间记录是按时、分、秒、毫秒一次排列组成一组数值。例如11:22:33:123转换后就是11223312.<br/><br/>◆将这100组时间数值合计，再与设置的价钱取余数，此余数加上10000000组成最终的“幸运码”。</p><p><br/></p>', '', '', '', null, '-1', '1', '1459674567', '1459674686');
